import './Input.css'

export function Input(){

return(
    <input className='customInput'>

    </input>
)
}

export  function Button(props:Props){

    return(
        <button name={props.name} style={{width:props.width}} className='customButton'>
          {props.children}
        </button>
    )
}

interface Props{
    name?:string;
    width?:string;
    children:ReactNode;
}
